import styles from './SliderElement.module.css'
import { motion } from 'framer-motion'
import { useState, useEffect } from 'react'

export default function SliderElement(props) {

    const onClick = () => {
        console.log("run")
        props.setFocusedElement(props.dataElement.id);
        props.onClickHandler();
    }

    const variants = {
        basic: {
          enter: { y: 0, opacity: 1 },
          exit: { y: 50, opacity: 0 }
        },
      };

  return (
    <div>
        <motion.div whileHover={{ scale: 1.05 }} whileTap={{ scale: 0.95 }} variants={variants.basic} onClick={props.isDragging == false ? onClick : null} onMouseEnter={() => props.setFocusedElement(props.dataElement.id)} onMouseLeave={() => props.setFocusedElement(-1)} className={styles.slide_element}>
        <img draggable="false" className={styles.cover} src={props.dataElement.img} alt="Cover Img" />
        </motion.div>
    </div>
  )
}
